[regex1]
regex: \d{1,2}/\d{1,2}/\d{2,4}
replace: DATE-STAMP

[regex2]
regex: \d{4}-\d{2}-\d{2}
replace: DATE-STAMP

[regex3]
regex: \d{2}:\d{2}:\d{2}
replace: TIME-STAMP

[regex4]
regex: id='[0-9a-f]{8}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{4}-[0-9a-f]{12}'>
replace: id='JUPYTERID'

[regex5]
regex: .*per loop .mean .* std. dev. of \d+ runs, \d+ loops? each.*
replace: TIMEIT-result
